% EZMILLER - Plots a flat map of the world with political boundaries
% version 2 - compatible with Mapping Toolbox 2.x
%
% USAGE: drawmiller
% drawmiller(lon)
%
% lon = optional longitude of the map center (default is zero)
%
% Notes:
% NOTES: (1) This is a miller cylindrical projection, which is pleasant
% to view while having a convenient rectangular map shape.
% (2) This version of EZMILLER is compatible with the Mapping
% Toolbox version 2.2
% (3) Coastlines are extracted from the "landareas.shp" file
% (4) Political boundaries are extracted from an older version
% of the Mapping Toolbox. The Mathworks points out that
% such data may be out of date in areas where political lines
% have changed since the creation of the data.
% (5) This function requires Java.
% (6) Tested but no warranty; use at your own risk.
% (7) version 1.0 for Mapping Toolbox 1.x, Michael Kleder, Oct 2004
% version 2.0 for Mapping Toolbox 2.x, Michael Kleder, Nov 2005

function ezmiller(varargin)
if nargin > 0
    lon = varargin{1};
else
    lon = 0;
end
figure
axesm miller
setm(gca,'origin',[0 lon])
s=shaperead('landareas.shp','UseGeoCoords',true);
% for n=1:length(s);
% plotm(s(n).Lat,s(n).Lon,'color',[.3 .3 .3])
% end
plotm([s(:).Lat],[s(:).Lon],'color',[.7 .7 .7])
z=getz;
z=typecast(z(:),'uint8');
Q=dunzip(z(1:end-6));
h=length(Q)/2;
R=Q(1:h);
D=Q(h+1:end);
M=double(R)+double(D)/32767;
M(M>145)=NaN;
h=length(M)/2;
t=M(1:h);
n=M(h+1:end);
plotm(t,n,'-','color',[.7 .7 .7])
%gridm
tightmap
return

function M = dunzip(Z)
% DUNZIP - decompress DZIP output to recover original data
%
% USAGE:
% M = dzip(Z)
%
% VARIABLES:
% Z = compressed variable to decompress
% M = decompressed output
%
% NOTES: (1) The input variable Z is created by the DZIP function and
% is a vector of type uint8
% (2) The decompressed output will have the same data type and
% dimensions as the original data provided to DZIP.
% (3) See DZIP for other notes.
% (4) Carefully tested, but no warranty; use at your own risk.
% (5) Michael Kleder, Nov 2005

import com.mathworks.mlwidgets.io.InterruptibleStreamCopier
a=java.io.ByteArrayInputStream(Z);
b=java.util.zip.InflaterInputStream(a);
isc = InterruptibleStreamCopier.getInterruptibleStreamCopier;
c = java.io.ByteArrayOutputStream;
isc.copyStream(b,c);
Q=typecast(c.toByteArray,'uint8');
cn = double(Q(1)); % class
nd = double(Q(2)); % # dims
s = typecast(Q(3:8*nd+2),'double')'; % size
Q=Q(8*nd+3:end);
if cn == 3
    M = logical(Q);
elseif cn == 4
    M = char(Q);
else
    ct = {'double','single','logical','char','int8','uint8',...
        'int16','uint16','int32','uint32','int64','uint64'};
    M = typecast(Q,ct{cn});
end
M=reshape(M,s);
return

